    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service proposes
    to open to waterfowl hunting the Boyer Chute NWR. Hunting activities will be permitted,
    but administratively limited to those areas specified in the refuge-specific regulations.
    All or parts of the refuge may be closed to hunting at any time if necessary for
    public safety, to provide wildlife sanctuary, or for other reasons.  This decision
    package for waterfowl hunting contains the Finding of No Significant Impact (FONSI)
    and the Environmental Assessment on waterfowl hunting at Boyer Chute National Wildlife
